    </div>
</template>

<script>
    export default {
        name: 'country-select',
        props: {
            question_id: Number
        },
        data() {
            return {
                hoveredCountry: String,
                selectedCountry: 'nomansland'
            }
        },
        methods: {
            hover(e) {
                var selectedCountry = e.target.id;
                e.target.setAttribute('fill', 'rgba(255,255,255,.3)');
                this.hoveredCountry = selectedCountry;
            },
            leave(e) {
                var selectedCountry = e.target.id;
                e.target.setAttribute('fill', 'transparent');
                this.hoveredCountry = String;
            },
            click(e) {
                var selectedCountry = e.target.id;
                this.selectedCountry = selectedCountry;
    
                console.log(selectedCountry + ' selected ðº');
            }
        },
        watch: {
            selectedCountry() {
                if (this.selectedCountry != 'nomansland') {
                    this.$parent.enableContinue();
                } else {
                    this.$parent.disableContinue();
                }
    
                var answer = {
                    value: this.selectedCountry,
                    unit: ''
                }
                this.$store.commit('COMMIT_CURRENT_ANSWER', answer);
            }
        },
    }
</script>

